import axios from 'axios';
import {FETCH_POST} from './types';

export const fetchPost = ()=> {
    const promise =  axios.get("https://jsonplaceholder.typicode.com/posts");

    return {
        type : FETCH_POST,
        payload : promise.data
    }
}
